  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态(预留字段)',
  `system_remarks` varchar(255) NOT NULL,
  `create_time` int(11) NOT NULL,
  `update_time` int(11) NOT NULL,
  `delete_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
